import React, { Component } from 'react';
import Footer from '../Footer.js';
import ScrollDown from '../Helpers/ScrollDown.js';
import ContactForm from '../Form/ContactForm.js';
import Header from '../Header.js';
import '../../Assets/Styles/Contact.css';

class Contact extends Component {
  constructor(props){
    super(props);
    this.myMap = this.myMap.bind(this);
  }

  myMap() {
    var mapProp= {
      center:new google.maps.LatLng(51.508742,-0.120850),
      zoom:5,
    };

    var map = new google.maps.Map(document.getElementById("googleMap"),mapProp);
    }

  render() {
    return (

      <div className="wrapper">
        <Header headerImage = "contact-header-image" />

        <div className="container">
          <main>
            <section className="first-section">
              <h2 className="first-section-title">Kontakta oss</h2>
              <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. 
              Consequuntur inventore dolorum nulla.</p>
              <ScrollDown />
            </section>

            <map className="contact-map">
              <div id="googleMap" style="width:100%;height:400px;"></div>
            </map>

            <ContactForm />
          </main>
        </div>

          <Footer />
        </div>

      )
  }
}

export default Contact;
